"use strict";
(function(){var a={};
a.downloadLinkClick=function(c){var h=$(c.currentTarget);
var e=decodeURIComponent(h.attr("href"));
var b=null;
if(e.indexOf("assetlist.download?downloadfile=")>-1){b=h.children(":first-child").text().replace(/^.*\//,"")
}else{b=e.replace(/^.*\//,"")
}var i=b.replace(/^.*\./,"").replace(/\?.*/,"").toUpperCase();
var d=b.replace(/\..*/,"");
var g=i+"|"+d;
var f=b.replace(/^.*\./,"").toUpperCase();
var k=b+", "+shell.metrics.URL;
shell.metrics.trackGAEvent("Downloads",f,k);
if(shell.hasComponent("siteCatalyst")){var j={fileInfo:g};
var l=["fileDownloaded","conversion"];
shell.components.siteCatalyst.fireEvents(l,j)
}};
a.externalLinkClick=function(e){var d=$(e.currentTarget).data("link");
shell.metrics.trackGAEvent("External Links",d,shell.metrics.URL);
if(shell.hasComponent("siteCatalyst")){var f=$(e.currentTarget);
var b={externalLink:d,exitLink:shell.metrics.URL};
var c=["externalLinkClicked","conversion"];
shell.components.siteCatalyst.fireEvents(c,b)
}};
a.init=function(){$(document).ready(function(){$(document).on("click",".cqview .shell.metrics_download",a.downloadLinkClick);
$(document).on("click",".cqview .shell.metrics_external",a.externalLinkClick)
})
};
a.init()
})();